import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import { Redirect } from 'react-router-dom';
import '../css/notfoundview.css';


class NotFoundView extends Component {
    
    render() {
        localStorage.clear();
        return (
            <div className="a_notfoundview">
                <img src={require('../images/logo_atenas.png')} />
                <h2>Página não encontrada</h2>
                <p>Parece que não conseguimos encontrar a página que procuras :(</p>
                <a className="a_notfoundview_link">Voltar à Home</a>
            </div>    
        )
        //}
    }
}


export default NotFoundView;
